import { Plan } from './Plan';
export class UserInfo {
    loggedIn;
    username;
    tier;
    accountBalance;
    constructor(loggedIn, userInfo) {
        this.loggedIn = loggedIn;
        this.username = userInfo.username;
        let tier;
        switch (userInfo.tier) {
            case Plan.TIER_0.key:
                tier = Plan.TIER_0;
                break;
            case Plan.TIER_1.key:
                tier = Plan.TIER_1;
                break;
            case Plan.TIER_2.key:
                tier = Plan.TIER_2;
                break;
            case Plan.TIER_3.key:
                tier = Plan.TIER_3;
                break;
        }
        this.tier = tier;
        this.accountBalance = userInfo.accountBalance;
    }
}
